Objetivo Geral:
Esta disciplina visa descrever os conceitos básicos relacionados a redes de computadores e sistemas
distribuídos.
Objetivos Específicos:
• Compreender os conceitos e características de redes de computadores;
• Analisar, projetar, implementar e avaliar sistemas de processamento de informação que utilizem
transmissão de dados;
• Compreender os conceitos, características e ferramentas existentes nos sistemas distribuídos;
• Identificar os componentes de um sistema distribuído;
• Identificar técnicas para comunicação entre processos;
• Implementar sistemas distribuídos;
